import React from 'react';

const PropertyComponent = ({ propertyData }) => {
  return (
    <section className="property-section">
      <h5 className="text-lg font-semibold mb-2">Available Properties</h5>
      <h2 className="text-2xl font-bold mb-6">Properties for Sale</h2>
      <div className="grid grid-cols-2 gap-8 md:grid-cols-1">
        {propertyData.map(({ id, image, title, address }) => (
          <article key={id} className="property-item bg-gray-200 p-6 rounded-md transition-transform transform hover:scale-105">
            <div className="property-image">
              <img src={image} alt={title} className="w-full h-32 object-cover rounded-md mb-4" />
            </div>
            <div className="property-details">
              <h3 className="text-xl font-semibold mb-2">{title}</h3>
              <p className="text-gray-700">{address}</p>
            </div>
          </article>
        ))}
      </div>
    </section>
  );
};

export default PropertyComponent;
